import React, { Component } from "react";

class Item extends Component {
  render() {
    const { name, src } = this.props.item;

    return (
      <React.Fragment>
        <p align="center">
          <img src={src} alt={name} />
          <h3>{name}</h3>
        </p>
      </React.Fragment>
    );
  }
}

export default Item;
